    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Watercress Darter NWR for the next 15 years.
    This plan outlines the Refuge vision and purpose and describes how Watercress Darter
    NWR will contribute to the overall mission of the Refuge System. The plan provides
    an introduction to the Refuge, an overview of the CCP process, information about
    plan development and the management direction, and strategies for implementation.
    Key planning issues include: fish and wildlife population management, habitat management,
    resource protection, visitor service, and administration.",nt"license_title":
